import React from "react";
import "./msg.css";
const Message = ({ user, message, classs }) => {
  return user ? (
    <div className={`msgBox ${classs}`}>{`:${message}`}</div>
  ) : (
    <div className="msgBox left">{message}</div>
  );
};

export default Message;
